import React from "react";
import "./App.css";
import ScrollingList from "./components/ScollingList/ScrollingList";
import data from "./mockData";
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ScrollingList data={data} />
      </header>
    </div>
  );
}

export default App;
